INSERT INTO `content` VALUES (64,'Про компанію','','about','','ozzi, інтернет-магазин, продукти харчування','Торгова марка Ozzi  це більше ніж швидко якісно та просто. Ми не лише здійснюємо замовлення та доставку продуктів через інтернет-магазин Ozzi.com.ua. Ми дбаємо про поінформованість клієнтів для свідомого та комфортного вибору.','<div class=\"title-h1\">Торгова марка &ldquo;Ozzi&rdquo; &mdash; це більше ніж швидко якісно та просто!</div>\n<p class=\"f-w_b f-s_15\">Ми не лише здійснюємо замовлення та доставку продуктів через інтернет-магазин Ozzi.com.ua. Ми дбаємо про проінформованість клієнтів для свідомого та комфортного вибору. Наша місія - революційно змінити Ваше життя на краще! Ми &mdash; прогресивні, і сміливо приймаємо виклики часу, щоб бути першими для перших!</p>\n<p>Погодьтесь, купувати в інтернет-магазині набагато швидше, аніж у звичайному. Вам не доводиться далеко їхати, довго шукати, потім обирати та самостійно транспортувати покупки. Часто це займає мало не пів дня. Навіщо витрачати цей час на рутину? Ви можете зайти на Ozzi.com.ua і зручно вмостившись на дивані, за лічені хвилини замовити продукти, товари для дому, корм для домашнього улюбленця, щось смачненьке на десерт чи будь-що інше.</p>\n<hr />\n<p class=\"f-w_b f-s_15\">Тм &ldquo;Ozzi&rdquo; пропонує колосальний вибір продуктів щоденного вжитку за помірною ціною</p>\n<p>Весь асортимент розташований у дуже простому, зрозумілому меню із чітким групуванням товарів. А це робить Вашу покупку на Ozzi.com.ua ще більш швидкою та зручною.Більше не потрібно ходити по тематичних магазинах та переплачувати в роздрібних торгових точках. З ТМ &ldquo;Ozzi-market&rdquo; ви купуєте все в одному місці, без жодних націнок.</p>\n<ul class=\"unstyled list-about\">\n<li>\n<div class=\"frame-icon\"><span class=\"helper\">&nbsp;</span> <span class=\"icon_about1\">&nbsp;</span></div>\n<div class=\"description\">ТМ &ldquo;Оззі&rdquo; є партнером ТМ &ldquo;Метро&rdquo;, тому вся продукція гарантовано якісна та свіжа, що забезпечується щоденним контролем спеціалістів.</div>\n</li>\n<li>\n<div class=\"frame-icon\"><span class=\"helper\">&nbsp;</span> <span class=\"icon_about2\">&nbsp;</span></div>\n<div class=\"description\">Замість того, щоб далеко їхати, довго шукати, потім обирати та ще й самостійно доставляти продукти, Ви виконуєте декілька простих рухів, і бажана річ уже на півдорозі до вашого дому.</div>\n</li>\n<li>\n<div class=\"frame-icon\"><span class=\"helper\">&nbsp;</span> <span class=\"icon_about3\">&nbsp;</span></div>\n<div class=\"description\">Для Вас працює оперативна служба доставки та зручні форми оплати замовлення.</div>\n</li>\n</ul>','',0,'about','',0,0,0,'publish','admin',1291295776,0,1392044737,828,3,0),(65,'Оплата','','oplata','','оплата','Оплата','<ul>\n<li><strong><span style=\"font-size: medium;\">Готівкою</span></strong></li>\n<li><strong><span style=\"font-size: medium;\">Карткою Visa або Master Card</span></strong></li>\n</ul>\n<p><span style=\"font-size: medium;\">Оплата здійснюється при отриманні замовлення.</span><br /><span style=\"font-size: medium;\">Наш кур&rsquo;єр матиме зі собою мобільний термінал у випадку здійснення розрахунку карткою.</span></p>\n<p>&nbsp;</p>\n<p><strong><span style=\"font-size: medium;\">ОНЛАЙН ГІПЕРМАРКЕТ OZZI &ndash; ЦЕ ЗАВЖДИ ЯКІСНІ ТА СВІЖІ ПРОДУКТИ!</span></strong></p>','',0,'','',0,0,0,'publish','admin',1291295824,1291295836,1396536110,365,3,0),(66,'Доставка','','dostavka','','доставка','Доставка','<p>Доставка здійснюється</p>\n<ul>\n<li>7 днів на тиждень</li>\n<li>З 9:00 до 21:00</li>\n</ul>\n<p>Вартість доставки по м. Львів</p>\n<ul>\n<li>Безкоштовно (замовлення від 150 грн)</li>\n<li>20 грн. (замовлення до 150 грн)</li>\n<li>35 грн. (Експрес-доставка протягом 1год. 30хв. )</li>\n</ul>\n<p>Вартість доставки за межі міста уточнюйте по телефону:</p>\n<p>+38 (097) 002-6-002<br />+38 (093) 002-6-002<br />+38 (032) 242-25-40</p>\n<h2>Важкі та об&rsquo;ємні замовлення</h2>\n<p>Важкі замовлення :</p>\n<p>понад 50 кг ( нетто ) доплата до вартості доставки + 5 грн за кожні 10 кг.</p>\n<ul>\n<li>вага від 51кг до 60кг доплата +5 грн</li>\n<li>вага від 61кг до 70 кг доплата +10 грн , і т.д</li>\n</ul>\n<p>Об\'ємні замовлення :</p>\n<ul>\n<li>при замовленні товару об&rsquo;ємом 2 -і та більше європалети* доплата до вартості доставки +30 грн за кожну</li>\n</ul>\n<p>*1 європалета = 1 м3 ( брутто)</p>\n<ul>\n<li>при замовленні товару , що розфасований у мішок (50 кг) , можливість доставки буде обговорюватися окремо з оператором контакт -центру.</li>\n<li>При замовленні більше 20 - ти одиниць одного й того ж товару , з Вами обов\'язково зв\'яжуться для уточнення його наявності та механізму оплати: якщо в наявності не буде необхідної кількості товару і потрібна буде спеціальна доставка здійснюється авансова передоплата замовлення.</li>\n</ul>','',0,'','',0,0,0,'publish','admin',1291295844,1291295851,1396537117,445,3,0),(67,'Помощь','','help','','помощь','Помощь','<p>Для того, чтобы приобрести товар в нашем магазине, Вам нужно выполнить несколько простых шагов:</p>\n<ul>\n<li>Выбрать нужный товар, воспользовавшить навигацией слева, либо поиском.</li>\n<li>Добавить товар в корзину.</li>\n<li>Перейти в корзину, выбрать способ доставки и указать Ваши контактные данные.</li>\n<li>Подтвердить заказ и выбрать способ оплаты.</li>\n</ul>\n<p>После этого наши менеджеры свяжуться с Вами и помогут с оплатой и доставкой товара, а также проконсультируют по любому вопросу.</p>','',0,'','',0,0,0,'publish','admin',1291295855,1291295867,1381918496,136,3,0),(68,'Контакти','','contact_us','','контакты','Контакты','<p>Сторінка на стадії розробки</p>','',0,'contacts','',0,0,0,'publish','admin',1291295870,1291295888,1383301166,423,3,0),(75,'Contact','','contact_us','','ssss','ssss','<p><span id=\"result_box\" lang=\"en\"><span>Hot Phone</span><span>:</span> <span>0800</span> <span>80</span> <span>80 800</span><br /><br /> <span>Head office in</span> <span>Moscow</span><br /><br /> <span>street</span><span>.<