INSERT INTO `mod_email_paterns_i18n` VALUES (1,'ru','Замовлення','<p><span>Вітаємо, $userName$!</span><br /><br />Ми вдячні Вам за те, що зробили замовлення в нашому магазині<br /><br />Ви вказали такі контактні дані:<br /><br /><span><strong>Email:</strong> $userEmail$</span><br /><br /><span><strong>Номер телефону:</strong> $userPhone$</span><br /><br /><span><strong>Адреса доставки:</strong> $userDeliver$</span>&nbsp;</p>\n<p><strong>Дата доставки:</strong>&nbsp;$orderDate$</p>\n<p><br />Менеджери нашого магазину незабаром зв\'яжуться з Вами і допоможуть з оформленням та оплатою товару.<br /><br /><span data-mce-mark=\"1\">Також, Ви можете завжди подивитися статус Вашого замовлення, перейшовши за посиланням:&nbsp;$orderLink$.</span><br /><br />Дякуємо за ваше замовлення, щиро Ваші, співробітники OZZI-market.<br /><br />В разі виникнення запитань, звертайтеся за телефонами:<br /><br /><strong>+38 (032) 242-25-40</strong></p>\n<p><strong>+38 (097) 002-6-002</strong></p>\n<p><strong>+38 (093) 002-6-002</strong></p>','<p>Користувач&nbsp;<span>$userName$ зробив замовлення</span></p>\n<p><span><span>Email: $userEmail$</span></span></p>\n<p><span>Номер телефону: $userPhone$</span></p>\n<p><span><span>Адреса доставки: $userDeliver$</span></span>&nbsp;</p>\n<p><span><span>Дата доставки:</span></span><span>&nbsp;$orderDate$</span></p>','<p><span>Повідомлення користувача про оформлення замовлення</span></p>','a:6:{s:10:\"$userName$\";s:31:\"Имя пользователя\";s:11:\"$userEmail$\";s:30:\"Email Пользователя\";s:11:\"$userPhone$\";s:39:\"Телефон Пользователя\";s:13:\"$userDeliver$\";s:27:\"Адрес доставки\";s:11:\"$orderLink$\";s:28:\"Ссылка на заказ\";s:11:\"$orderDate$\";s:42:\"Дата исполнения заказа\";}'),(2,'ru','Смена статуса заказа','<p><span>Здравствуйте, $userName$.</span><br /><br /><span>Статус вашего заказа изменен на&nbsp;<span>$status$</span></span><br /><br /><span>Вы указали следующие контактные данные:</span><br /><br /><span>Email адрес: $userEmail$</span><br /><br /><span>Номер телефона: $userPhone$</span><br /><br /><span>Адрес доставки: $userDeliver$</span><br /><br /><span>Менеджеры нашего магазина вскоре свяжутся с Вами и помогут с оформлением и оплатой товара.</span><br /><br /><span>Также, Вы можете всегда посмотреть за статусом Вашего заказа, перейдя по ссылке:&nbsp; $orderLink$.</span><br /><br /><span>Спасибо за ваш заказ, искренне Ваши, сотрудники ImageCMS Shop.</span><br /><br /><span>При возникновении любых вопросов, обращайтесь за телефонами:</span><br /><br /><span>+7 (095) 222-33-22 +38 (098) 222-33-22</span>&nbsp;</p>','','<p>Смена статуса заказа</p>','a:4:{s:10:\"$userName$\";s:31:\"Имя пользователя\";s:11:\"$userEmail$\";s:30:\"Email Пользователя\";s:11:\"$orderLink$\";s:28:\"Ссылка на заказ\";s:8:\"$status$\";s:25:\"статус заказа\";}'),(3,'ru','Уведомление','<p><span>Здравствуйте, $userName$.</span><br /><br /><span>Статус товара $productName$&nbsp;за которым вы следите изменен на <span>$status$</span></span><br /><br /><span>Спасибо за ваш заказ, искренне Ваши, сотрудники ImageCMS Shop.</span><br /><br /><span>При возникновении любых вопросов, обращайтесь за телефонами:</span><br /><br /><span>+7 (095) 222-33-22 +38 (098) 222-33-22</span>&nbsp;</p>','','<p>Уведомление о появлении</p>','a:4:{s:10:\"$userName$\";s:31:\"Имя пользователя\";s:11:\"$userEmail$\";s:30:\"Email Пользователя\";s:13:\"$productName$\";s:33:\"Название продукта\";s:8:\"$status$\";s:12:\"Статус\";}'),(4,'ru','Реєстрація нового користувача','<p>Вітаю, $user_name$, Ви успішно зареєструвались на сайті <a href=\"http://ozzi.com.ua/\">ozzi.com.ua</a></p>\n<p><strong>Дані для входу на сайт:</strong><br /> Логін: $user_email$<br /> Пароль: $user_password$</p>','<p><span>Створено користувача $user_name$:</span><br /><span>З паролем: $user_password$</span><br /><span>Адресом: &nbsp;$<span>user_</span>address$</span><br /><span>Email користувача: $user_email$</span><br /><span>Телефон користувача: $user_phone$</span></p>','<p>Шаблон повідомлення про створення новгого користувача</p>','a:5:{s:11:\"$user_name$\";s:31:\"Имя пользователя\";s:14:\"$user_address$\";s:35:\"Адрес пользователя\";s:15:\"$user_password$\";s:37:\"Пароль пользователя\";s:12:\"$user_phone$\";s:39:\"Телефон пользователя\";s:12:\"$user_email$\";s:30:\"Email пользователя\";}'),(5,'ru','Відновлення пароля','<p>Вітаю!<br /><br />На сайті <a title=\"Онлайн-гіпермаркет OZZI\" href=\"http://ozzi.com.ua/\" target=\"_blank\">ozzi.com.ua</a> створений запит на відновлення пароля для Вашого аккаунта.<br /><br />Для завершення процедури відновлення пароля перейдіть за <a href=\"$resetPasswordUri$\" target=\"_blank\">посиланням</a><br /><br />Ваш новий пароль для входу: <strong>$password$</strong><br /><br />Якщо цей лист потрапив до Вас помилково просто ігноруйте його.<br /><br />При виникненні будь-яких питань, звертайтесь за телефонами:<br /><br /><strong>(097) 002-6-002</strong></p>\n<p><strong>(093) 002-6-002</strong></p>\n<p><strong>(032) 242-25-40</strong><br /><br />---<br /><br />З повагою,<br /><br />адміністрація сайту <a title=\"Онлайн-гіпермаркет OZZI\" href=\"http://ozzi.com.ua/\" target=\"_blank\">ozzi.com.ua</a></p>','','<p>Шаблон листа на відновлення пароля</p>','a:1:{s:10:\"$password$\";s:12:\"пароль\";}'),(6,'ru','Смена пароля','<p><span>Здравствуйте $user_name$!</span><br /><br /><span>Ваш новый пароль для входа: $password$</span><br /><br /><span>Если это письмо попало к Вам по ошибке просто проигнорируйте его.</span><br /><br /><span><br /></span></p>','','<p>Шаблон письма изменения пароля</p>','a:2:{s:11:\"$user_name$\";s:31:\"Имя пользователя\";s:10:\"$password$\";s:23:\"Новий пароль\";}'),(20,'ru','Изменение цены','<p>Цена на $name$ за которым вы следите на сайте $server$ изменилась.<br /> <a title=\"Посмотреть список слежения\" href=\"$list_url_look$\">Посмотреть список слежения</a><br /> <a title=\"Отписатся от слежения\" href=\"$delete_list_url_look$\">Отписатся от слежения</a></p>\n<div id=\"dc_vk_code\">&nbsp;</div>','<p>&nbsp;</p>\n<div id=\"dc_vk_code\">&nbsp;</div>','<p>Изменение цены</p>\n<div id=\"dc_vk_code\" style=\"display: none;\">&nbsp;</div>',''),(20,'ua','Ціна змінилася','<p>Ціна на $name$ за яким Ви слідкуєте на сайті $server$ змінилася.<br /> <a title=\"Переглянути список слідкувань\" href=\"$list_url_look$\">Переглянути список слідкувань</a><br /> <a title=\"Відписатися від слідкування\" href=\"$delete_list_url_look$\">Відписатися від слідкування</a></p>\n<div id=\"dc_vk_code\"  none;\">&nbsp;</div>','<p>&nbsp;</p>\n<div id=\"dc_vk_code\">&nbsp;</div>','<p>Слідкування за ціною</p>\n<div id=\"dc_vk_code\" style=\"display: none;\">&nbsp;</div>',''),(111,'ru','Список Желаний','<h2>Уважаемый $userName$.</h2>\n<p>Вы создали следующий список желаний $wishName$ null</p>\n<div>Ссылка на просмотр списка желаний -&nbsp;&nbsp; $wishLink$ <br /> Количество просмотров списка - $wishListViews$</div>','<p>Пользователь&nbsp;<span>$userName$ совершил заказ товара&nbsp;</span></p>\n<p><span><span>Email адрес: $userEmail$</span><br /><br /><span>Номер телефона: $userPhone$</span><br /><br /><span>Адрес доставки: $userDeliver$</span></span></p>','<p><span>Уведомление покупателя о совершении заказа</span></p>','a:4:{s:10:\"$userName$\";s:31:\"Имя пользователя\";s:10:\"$wishName$\";s:29:\"Название списка\";s:10:\"$wishLink$\";s:30:\"Ссилка на список\";s:15:\"$wishListViews$\";s:54:\"Количество просмотров списка\";}');
